    [],nt"revision_timestamp": "2015-01-22T15:57:59.629709",nt"name": "sandy-damage-estimates-by-block-group",nt"isopen":
    false,nt"url": null,nt"notes": "A FEMA housing inspection for renters is
    used to assess personal property loss and for owners to assess damage to their home
    as well as personal property. This inspection is done to determine eligibility for
    FEMA Individual Assistance. For both rental and owner inspections, if the property
    has flood damage the inspector measures the height of the flooding. They indicate
    the highest floor of the flooding (for example, Basement, 1st floor, 2nd floor,
    etc...) and the height of the flooding in that room. In addition for the units without
    flooding, HUD has estimated minor/major/severe damage based on the damage inspection
    estimates for real property (owner) and personal property (renter).",nt"license_title":
